import "./app.scss"
import Home from "./pages/Home/Home";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import Watch from "./pages/Watch/Watch";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return ( <Switch>
    <Route path="/">
      <Home />
    </Route>
    <Route path="/users">
      <Login />
    </Route>
    <Route path="/">
      <Home />
    </Route>
  </Switch>)
}

export default App;
